import { Counter } from './counterredux';



const store = createStore(Counter,   window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());
store.subscribe(()=>{
    console.log(store.getState())
})
store.dispatch({ type:'counter/increment'})
store.dispatch({ type:'counter/increment'})
